import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const Profile = ({ userId, token }) => {
    const [properties, setProperties] = useState([]);

    useEffect(() => {
        const fetchProperties = async () => {
            try {
                const response = await fetch(`http://localhost:5000/users/${userId}/properties`, {
                    method: 'GET',
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });

                if (response.ok) {
                    const data = await response.json();
                    setProperties(data);
                } else {
                    const errorData = await response.json();
                    console.error('Error fetching properties:', errorData.error);
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        fetchProperties();
    }, [userId, token]);

    const handleDelete = async (propertyId) => {
        try {
            const response = await fetch(`http://localhost:5000/properties/${propertyId}`, {
                method: 'DELETE',
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });

            if (response.ok) {
                setProperties(properties.filter(property => property.id !== propertyId));
            } else {
                const errorData = await response.json();
                console.error('Error deleting property:', errorData.error);
            }
        } catch (error) {
            console.error('Error:', error);
        }
    };

    return (
        <div>
            <h1>My Properties</h1>
            <ul>
                {properties.map(property => (
                    <li key={property.id}>
                        <h2>{property.title}</h2>
                        <p>{property.description}</p>
                        <p>{property.location}</p>
                        <p>{property.price}</p>
                        <img src={`http://localhost:5000/images/${property.image}`} alt={property.title} />
                        <Link to={`/editproperty/${property.id}`}>Edit Property</Link> {/* Edit button */}
                        <button onClick={() => handleDelete(property.id)}>Delete Property</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default Profile;
